package project;

public class Fibonacci {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int n =10;
int first=1;
int second=2;
System.out.println("fibonaaci series");

for(int i=1;i<=n;i++) {
	System.out.println(first+"");
	int next=first+second;
	first=second;
	second=next;
}
	

}
	}